import React from "react";
import "../components/About.css";

function About() {
  return (
    <div className="about-container">
      <div className="about-left">
        <img src="https://via.placeholder.com/300" alt="static" />
      </div>
      <div className="about-right">
        <h2>About Us</h2>
        <div className="slider">
          <div className="slide">
            <p>Slide 1 Content</p>
          </div>
          <div className="slide">
            <p>Slide 2 Content</p>
          </div>
          <div className="slide">
            <p>Slide 3 Content</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
